import React from 'react';

const FeedBackItem = ({ratings,text}) => {
  return (
      <li className='feedbackItem'>
      <div className='rating'>{ratings}</div>
      <div className='item'>{text}</div>
      </li>
  )
};

export default FeedBackItem;
